import React from 'react'

export default function Activity({activity}) {
    const name = activity.map(e =>e.name)
    const difficulty = activity.map(e=>e.difficulty)
    const season = activity.map(e=>e.season)
    const duration = activity.map(e=>e.duration)
  return (
    <div className='box'>
        <div>{name}</div>
        <div>{difficulty}</div>
        <div>{season}</div>
        <div>{duration}</div>
    </div>
  )
}
